import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";


const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginForm />} />
        <Route path="/doctor" element={<DoctorList />} />
      </Routes>
    </Router>
  );
};

export default App;
